import Image from 'next/image';
import { SlideStyles } from './SlideStyles';

export default function Slide({}) {
  return (
    <SlideStyles>
      <div className='product-item'>
        <Image
          className='product-image'
          src={mediaByIndex()}
          width={300}
          height={300}
          layout='responsive'
        />
      </div>
    </SlideStyles>
  );
}
